	def makeHongKongID(self, BornYear):
		ID = ''
		if int(BornYear) > 2004:
			head = 'S'
		elif int(BornYear) > 1989:
			head = 'Y'
		elif int(BornYear) == 1988:
			head = 'Z'
		else:
			raise Exception('Please make sure BornYear more than 1988.')
		ID += head
		Value = (self.characterList.index(head) + 1) * 8
		for i in range(6):
			ID += random.choice([str(i) for i in range(10)])
		num = 7
		for i in range(1,7):
			Value += int(ID[i]) * num
			num -= 1
		remainder = Value % 11
		if remainder > 10:
			self.makeHongKongID()
			return
		elif remainder == 0:
			tail = '(0)'
		elif remainder == 1:
			tail = '(A)'
		else:
			tail = '(' + str(11 - remainder) + ')'
		ID += tail
		return ID


	def makeTaiWanID(self, cityCode=None, sex='Female'):
		ID = ''
		if cityCode:
			num += (self.characterList.index(cityCode) + 10)
		else:
			data = random.choice(self.taiwanCityList)
			cityCode = data['CityCode']
			num = data['Value']
		ID += cityCode
		if sex == 'Female':
			code = '1'
		else:
			code = '2'
		ID += code
		for i in range(7):
			ID += random.choice([str(i) for i in range(10)])
		Value = num//10 + num%10 * 9 + int(code) * 8
		number = 7
		for i in range(2, 9):
			Value += int(ID[i]) * number
			number -= 1
		tail = str(10 - Value % 10)
		ID += tail
		return ID


	def makeMotherLandID(self, CityCode=None, sex='Female'):
		ID = ''
		if CityCode:
			ID += CityCode
		else:
			CityCode = random.choice(self.motherList)['CityCode']
			ID += CityCode
		year = str(random.randint(1988, 2003))
		month = random.randint(1, 13)
		if month < 10:
			month = '0'+str(month)
		else:
			month = str(month)
		if month == '2':
			day = random.randint(1, 29)
		else:
			day = random.randint(1, 31)
		if day < 10:
			day = '0'+str(day)
		else:
			day = str(day)
		ID += year + month + day
		ID += str(random.randint(100,300))
		weight = [7, 9, 10, 5, 8, 4, 2, 1, 6, 3, 7, 9, 10, 5, 8, 4, 2]
		checkcode ={'0':'1','1':'0','2':'X','3':'9','4':'8','5':'7','6':'6','7':'5','8':'5','9':'3','10':'2'}
		Value = 0
		for i in range(17):
			Value = (int(ID[i])*weight[i])%11
		tail = checkcode['{}'.format(Value)]
		ID += tail
		return ID


	


